import React from "react";
import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";

const ProfileRest = () => {
  return (
    <div>
      <h1 className="header-rest">A comer!</h1>
      <h3
        style={{
          fontFamily: "GothamBold",
          display: "flex",
          justifyContent: "center",
          fontSize: "24px",
          margin: "20px",
          paddingTop: "20px",
        }}
      >
        Bienvenida
      </h3>
      <p
        style={{
          fontFamily: "GothamBold",
          display: "flex",
          justifyContent: "center",
          fontSize: "25px",
        }}
      >
        Fonda Don José
      </p>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          flexDirection: "column",
          width: "90%",
        }}
      >
        <img src="https://cdn.pixabay.com/photo/2016/12/26/17/28/spaghetti-1932466_960_720.jpg"></img>
      </div>
      <div>
        <p
          style={{
            color: "#2FB423",
            flexDirection: "row-reverse",
            display: "flex",
          }}
        >
          Cambiar imagen
        </p>
      </div>

      <div
        style={{
          fontFamily: "GothamBook",
          fontSize: "14px",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          padding: "10px 0",
        }}
      >
        <Button
          size="lg"
          style={{
            padding: "12px 100px",
            border: " 3px solid #fb923c",
            backgroundColor: "#F3F4F6",
            color: "#000000",
            borderRadius: "10px",
            margin: "10px 0",
          }}
        >
          Mis pedidos
        </Button>
        <Button
          size="lg"
          style={{
            padding: "12px 105px",
            border: " 3px solid #fb923c",
            backgroundColor: "#F3F4F6",
            color: "#000000",
            borderRadius: "10px",
            margin: "10px 0",
          }}
        >
          Mis menús
        </Button>
        <Button
          size="lg"
          style={{
            padding: "12px 100px",
            border: " 3px solid #fb923c",
            backgroundColor: "#F3F4F6",
            color: "#000000",
            borderRadius: "10px",
            margin: "10px 0",
          }}
        >
          Mis platillos
        </Button>
      </div>
    </div>
  );
};

export default ProfileRest;
